@charset "UTF-8";

* {
    margin: 0;
    padding: 0;
    outline: none;
}

header {
    height: 400px;
    section:first-child {
        display: flex;
        background-color: black;
        justify-content: space-between;
        padding: 10px;
        color: white;
        section:first-child {
            width: 200px;
            display: flex;
            align-items: center;
            button {
                height: 40px;
                border: none;
                background-color: transparent;
                color: inherit;
                font-weight: bold;
                font-size: 1.1rem;
                width: 100px;
                display: flex;
                align-items: center;
                justify-content: space-around;
                img {
                    width: 10px;
                    height: 10px;
                    background-color: blue;
                }
            }
            a {
                border-left: 2px solid white;
                padding-left: 12.5px;
                color: inherit;
                text-decoration: none;
                &:hover {
                    text-decoration: underline;
                }
            }
        }
        section:last-child {
            display: flex;
            align-items: center;
            button {
                background-color: transparent;
                border: none;
            }
        }
